import React, { Component } from 'react';
import './App.css';
import { getSuggestions } from './mock-server'

class App extends Component{
  constructor() {
    super();
    this.state = {
      n: '',
      a: 1,
    }
  }

  handleClick(e) {
    let value = document.getElementById('searchBox').value;
    const x = getSuggestions(value);
    console.log('x', x);
  }

  render() {
    return (
      <div className="app">
       <input id="searchBox" onKeyDown={this.handleClick}></input>
      </div>
    );
  }
}
export default App;
